import React, { Component } from 'react';

class Footer extends Component {

  render() {
       	return(
       		<div className="footer">
	          <span className="fa fa-heartbeat col" aria-hidden="true"></span>
	          <span className="fa fa-home col" aria-hidden="true"></span>
	          <span className="fa fa-prescription col" aria-hidden="true"></span>
        	</div>
       	);
      }
}
export default Footer;
